import React, { useState } from 'react';
import './pages.css'

export const StartPage = (props) => {

    const [selectCharacter, setSelectCharacter] = useState(0);

    function SelectCharacter (i) {
        if(selectCharacter === i) {
            setSelectCharacter(0);
        }
        else {
            setSelectCharacter(i);
        }
    }

    return(
            <div className='startpage'>
                <div className='startbox'>
                    <div className='roundBar'></div>
                    <div className='setting'>
                        <div className='setCharacter'>
                            <div className='settingTitle'>캐릭터 선택</div>
                            <div className='characterHolder'>
                                <img src='professor/character1.png' className='character' onClick={() => SelectCharacter(1)} alt='character1'/>
                                <img src='/professor/character2.png' className='character' onClick={() => SelectCharacter(2)} alt='character2'/>
                                <img src='/professor/character3.png' className='character' onClick={() => SelectCharacter(3)} alt='character3'/>
                                <img src='/professor/character4.png' className='character' onClick={() => SelectCharacter(4)} alt='character4'/>
                                <img src='/professor/character5.png' className='character' onClick={() => SelectCharacter(5)} alt='character5'/>
                            </div>
                        </div>
                        <div className='setGoal'>
                            <div className='settingTitle'>피드백 목표</div>
                            <input></input>
                        </div>
                        <div className='setTime'>
                            <div className='settingTitle'>시간 설정</div>
                        </div>
                    </div>
                    <button className='startButton'>start</button>
                </div>
            </div>
    )
}
